
create table T_jo_ADDRESS
(
  addr_id     INTEGER not null,
  city        VARCHAR2(50) not null,
  street      VARCHAR2(100) not null,
  house_num   INTEGER not null,
  apT_jo_num     INTEGER,
  postal_code INTEGER,
  po_box      INTEGER,
  primary key (ADDR_ID)
)

create table T_jo_DEPARTMENT
(
  depT_jo_id    INTEGER not null,
  depT_jo_desc  VARCHAR2(500) not null,
  depT_jo_name  VARCHAR2(50) not null,
  depT_jo_phone INTEGER not null,
  depT_jo_email VARCHAR2(50) not null
)

create table T_jo_ADDRDEPT
(
  depT_jo_id INTEGER not null,
  addr_id INTEGER not null,
  primary key (DEPT_jo_ID, ADDR_ID),
  foreign key (DEPT_jo_ID) references T_jo_DEPARTMENT (DEPT_jo_ID),
  foreign key (ADDR_ID) references T_jo_ADDRESS (ADDR_ID)
)

create table T_jo_ADVERTISEMENT
(
  advertisementid  INTEGER not null,
  publicationdate  DATE not null,
  publicationtype  VARCHAR2(30) not null,
  advertisemencost FLOAT not null,
  primary key (ADVERTISEMENTID)
)

create table T_jo_LOGIN
(
  login_id   INTEGER not null,
  mypassword VARCHAR2(8) not null,
  username   VARCHAR2(50) not null,
  primary key (LOGIN_ID)
)

create table T_jo_PERSON
(
  idperson    INTEGER not null,
  birthdate   DATE not null,
  kodgender   CHAR(1) not null,
  citizenship VARCHAR2(50) not null,
  fname       VARCHAR2(50) not null,
  lname       VARCHAR2(50) not null,
  email       VARCHAR2(50),
  phone       INTEGER,
  status      VARCHAR2(30),
  addr_id     INTEGER,
  primary key (IDPERSON),
  foreign key (ADDR_ID)references T_jo_ADDRESS (ADDR_ID)
)

create table T_jo_EMPLOYEE
(
  emp_id     INTEGER not null,
  hire_date  DATE,
  work_phone INTEGER,
  work_email VARCHAR2(50) not null,
  login_id   INTEGER,
  idperson   INTEGER not null,
  primary key (EMP_ID),
  foreign key (LOGIN_ID) references T_jo_LOGIN (LOGIN_ID),
  foreign key (IDPERSON) references T_jo_PERSON (IDPERSON)
)

create table T_jo_ADVERTISINGOFFICE
(
  officename          VARCHAR2(30) not null,
  address             VARCHAR2(30) not null,
  phone               VARCHAR2(20) not null,
  email               VARCHAR2(30) not null,
  advertisingofficeid INTEGER not null,
  primary key (ADVERTISINGOFFICEID)
)

create table T_jo_ADVERTISINGWORKER
(
  advertisingworkerid INTEGER not null,
  advertisingofficeid INTEGER not null,
  emp_id              INTEGER not null,
  primary key (ADVERTISINGWORKERID),
  foreign key (EMP_ID) references T_jo_EMPLOYEE (EMP_ID),
  foreign key (ADVERTISINGOFFICEID) references T_jo_ADVERTISINGOFFICE (ADVERTISINGOFFICEID)
)

create table T_jo_ADVERTISEMENTSOFADVERTISINGWORKER
(
  advertisingworkerid INTEGER not null,
  advertisementid     INTEGER not null,
  primary key (ADVERTISINGWORKERID, ADVERTISEMENTID),
  foreign key (ADVERTISINGWORKERID) references T_jo_ADVERTISINGWORKER (ADVERTISINGWORKERID),
  foreign key (ADVERTISEMENTID) references T_jo_ADVERTISEMENT (ADVERTISEMENTID)
)

create table T_jo_AUDITS
(
  audiT_jo_id         NUMBER generated by default as identity,
  table_name       VARCHAR2(255),
  transaction_name VARCHAR2(10),
  by_user          VARCHAR2(30),
  transaction_date DATE,
  primary key (AUDIT_jo_ID)
)


create table T_jo_ROLE
(
  role_id   INTEGER not null,
  role_name VARCHAR2(50) not null,
  role_desc VARCHAR2(500) not null,
  depT_jo_id   INTEGER not null,
  primary key (ROLE_ID, DEPT_jo_ID),
  foreign key (DEPT_jo_ID) references T_jo_DEPARTMENT (DEPT_jo_ID)
)

create table T_jo_EMPROLE
(
  emp_id  INTEGER not null,
  role_id INTEGER not null,
  depT_jo_id INTEGER not null,
  sal_val INTEGER,
  primary key (EMP_ID, ROLE_ID, DEPT_jo_ID),
  foreign key (EMP_ID) references T_jo_EMPLOYEE (EMP_ID),
  foreign key (ROLE_ID, DEPT_jo_ID) references T_jo_ROLE (ROLE_ID, DEPT_jo_ID)
)

create table T_jo_JOB_REVIEW
(
  job_id     INTEGER not null,
  starT_jo_date DATE not null,
  end_date   DATE,
  progress   VARCHAR2(500),
  depT_jo_id    INTEGER not null,
  role_id    INTEGER not null,
  emp_id     INTEGER not null,
  proj_name  VARCHAR2(20),
  primary key (JOB_ID, EMP_ID, ROLE_ID, DEPT_jo_ID),
  foreign key (EMP_ID) references T_jo_EMPLOYEE (EMP_ID),
  foreign key (ROLE_ID, DEPT_jo_ID) references T_jo_ROLE (ROLE_ID, DEPT_jo_ID)
)

create table T_jo_PURCHASINGWORKER
(
  purchasingbudget   FLOAT not null,
  purchasingworkerid INTEGER not null,
  emp_id             INTEGER not null,
  primary key (PURCHASINGWORKERID),
  foreign key (EMP_ID) references T_jo_EMPLOYEE (EMP_ID)
)

create table T_jo_PURCHASE
(
  purnum             INTEGER not null,
  purchasingdate     DATE not null,
  purchasecost       FLOAT not null,
  purchasingworkerid INTEGER not null,
  primary key (PURNUM, PURCHASINGWORKERID),
  foreign key (PURCHASINGWORKERID)  references T_jo_PURCHASINGWORKER (PURCHASINGWORKERID)
)

create table T_jo_PURCHASE_ITEMS
(
  items              VARCHAR2(30) not null,
  purnum             INTEGER not null,
  purchasingworkerid INTEGER not null,
  primary key (ITEMS, PURNUM, PURCHASINGWORKERID),
  foreign key (PURNUM, PURCHASINGWORKERID) references T_jo_PURCHASE (PURNUM, PURCHASINGWORKERID)
)

create table T_jo_SALARY
(
  val      INTEGER,
  sal_date DATE not null,
  emp_id   INTEGER not null,
  primary key (EMP_ID, SAL_DATE),
  foreign key (EMP_ID) references T_jo_EMPLOYEE (EMP_ID)
)

